import { mapState,mapMutations,mapActions,mapGetters } from 'vuex';
import { inputKG } from "../../api/basicAPI";
import OpItem from './OpItem';
import EditBarBlock from "./EditBarBlock";
import MyButton from "@/components/Tools/MyButton";


export default {
    name: "EditBar",
    components: {OpItem,EditBarBlock, MyButton},
    data(){
        return{
            showEditBar: true,
            showExportOps: false,
            opInfo: '".json"\n',
            entities_data: [],
            relations_data: [],

            /////////////////////////////////////////////////////////////
            max_log_len: 10,

            search_node_text: [],
            search_node_condition: [],
            node_searched: false,
            search_node_log: [],

            search_edge_text:[],
            search_edge_condition: [],
            edge_searched:false,
            search_edge_log: [],

            // search_text: '',
            // search_type: '',
            // select_value: '',
            // showEnabled: false,
            // edgeDisabled: true,
            // types: [
            //     {
            //         label: '',
            //         value: '1'
            //     },
            //     {
            //         label: '',
            //         value: '2'
            //     }
            // ],
            // currentSearch: {
            //     params: {},
            //     result: []
            // },
            // searchLog: [],

            ///////////////////////////////////////////////////

            filter_node_checkList: [],
            filter_edge_checkList: [],

            // filter_disabled: true,
            // filterShowEnabled: false,
            //
            // filter_node_checked: false,
            // filter_node_checkList: [],
            // filter_edge_checked: false,
            // filter_edge_checkList: [],

            //////////////////////////////////////////////////////

            layout: null,

            layoutTypeNow : '',

            relation_label_enabled: true,
            font_size: 20,
            node_radius: 20,
        }
    },
    watch: {
        cy(newValue, oldValue){
            this.get_statistic_data();
            this.layoutTypeNow = newValue.options().layout.name;
        },
        statistic_data_change(newValue, oldValue){
            console.log("")
            this.get_statistic_data();
        },

        ///////////////////////////////////////////////////////////
        layoutTypeNow(newVal, oldVal) {
            console.log("layout watched: '",oldVal,"' to '",newVal,"'");
            let layout = this.layout;
            if(layout!==null){
                layout.stop();
            }
            if(newVal==='preset'){
                //console.log("elements stored: ",this.elements);
                let nodes = this.elements.nodes;
                let positions = node=>{
                    let nodeId = node.data("id");
                    for(let node of nodes){
                        if(node.data.id===nodeId){
                            return node.position;
                        }
                    }
                    return {x:0,y:0};//
                };
                layout = this.cy.layout({name: newVal,fit:true,positions:positions});//
                //console.log("reset done")

            }else if(newVal==='d3-force'){
                let d3_options = {
                    name: 'd3-force',
                    animate: true,
                    fit: true,//viewport
                    fixedAfterDragging: false,
                    linkId: function id(d) {
                        return d.id;
                    },
                    linkDistance: 1000,
                    manyBodyStrength: -10000,
                    ready: function(){},
                    stop: function(){},
                    tick: function(progress) {
                        // console.log('progress - ', progress);
                    },
                    randomize: false,
                    infinite: true
                }
                layout = this.cy.layout(d3_options)
            }else{
                layout = this.cy.layout({name: newVal, fit: true})
            }
            this.layout = layout;
            this.layout.run();
        },
        relation_label_enabled(newVal, oldVal) {
            let edges = this.cy.edges();
            let enabled = newVal;
            for (let edge of edges) {
                if(enabled&&edge.hasClass('label_hidden')){
                    edge.removeClass('label_hidden');
                }else if(!enabled&&!edge.hasClass('label_hidden')){
                    edge.addClass('label_hidden');
                }
            }
        },
        font_size(newVal, oldVal) {
            // let defaultSize = '25px';//25pxworkspace
            if (newVal === '') {
                this.setNodeFontSize('');//workspacenodeNodeFontSize
                //CytoscapeKGworkspacenodeFontSize''
                //
                //CytoscapeKG
                return;
            }
            let size = Number(newVal);
            if (!isNaN(size)) {
                this.setNodeFontSize(newVal);//workspacenodeNodeFontSize
                size = parseInt(size);
                for (let node of this.cy.nodes()) {
                    node.style('font-size', size + 'px');
                }
            }
            else {
                if (newVal !== '') {
                    this.informMsg('error','');
                }
                this.setNodeFontSize('');//workspacenodeNodeFontSize
                //CytoscapeKGworkspacenodeFontSize''
                //
                //CytoscapeKG
            }
        },
        node_radius(newVal, oldVal) {
            if (newVal === '') {
                this.setNodeRadius('');//workspacenodeRadius
                for (let node of this.cy.nodes()) {
                    node.removeStyle('width');
                    node.removeStyle('height');
                }
                return;
            }
            let radius = Number(newVal);
            if (!isNaN(radius)) {
                radius = parseInt(radius);
                let realRadius = radius * 2;
                this.setNodeRadius(realRadius+"");//workspacenodeRadius
                for (let node of this.cy.nodes()) {//
                    node.style('width', realRadius + 'px');
                    node.style('height', realRadius + 'px');
                }
            }
            else {
                this.setNodeRadius('');//workspacenodeRadius
                if (newVal !== '') {
                    this.informMsg('error','');
                }
                for (let node of this.cy.nodes()) {
                    node.removeStyle('width');
                    node.removeStyle('height');
                }
            }
        }
    },
    computed: {
        ...mapState({
            cy: state => state.workspace.cy,
            statistic_data_change: state => state.workspace.statistic_data_change,
            nodeType: state => state.workspace.nodeType,
            edgeType: state => state.workspace.edgeType,
            layoutType: state => state.workspace.layoutType,
            elements: state => state.workspace.elements,
            pid: state => state.pid,
        }),
        node_checkList_disabled: {
            get() {
                return !this.filter_node_checked;
            }
        },
        edge_checkList_disabled: {
            get() {
                return !this.filter_edge_checked;
            }

        },
    },
    methods:{
        ...mapMutations(['setJsonSrcPath', 'setSeCurrentSearchParams',
            'setCurrentSearchResult','setNodeRadius','setNodeFontSize', 'setProject', 'changeShowQAPanel']),

        changeEditBarState(){
            this.showEditBar = !this.showEditBar;
        },

        open(){
            document.getElementsByClassName("choose-file")[0].click();
        },

        getFilePath(){
            //File
            let selectedFile = document.getElementsByClassName("choose-file")[0].files[0];
            let reader = new FileReader();//,.
            reader.readAsDataURL(selectedFile)
            reader.that = this;
            reader.onload = function () {
                //,this.result,
                this.that.setJsonSrcPath(this.result);
            }
        },

        save(){
            let data = {};
            let graphData = this.getDataJsonObject();
            data = {
                nodes: graphData.nodes,
                edges: graphData.edges
            };

            data = this.getCleanData(data);
            console.log("",data);

            const loading = this.$loading({
                lock: true,
                text: '......',
                spinner: 'el-icon-loading',
                background: 'rgba(255, 255,255, 0.8)'
            });
            inputKG({...data, pid: this.pid}).then(res => {
                if(res.success){
                    this.setProject(data);
                    this.$message.success('');
                }else{
                    this.$message.error( '')
                }
            }).catch( err => {
                console.log(err);
                this.$message.error('')
            }).finally(() => {
                loading.close();
            })
        },

        changeExportState(){
            this.showExportOps = !this.showExportOps;
        },

        /**
         * .
         * options: The export options.
         output Whether the output should be 'base64uri' (default), 'base64', 'blob', or 'blob-promise' (a promise that resolves to the blob is returned).
         bg: The background colour of the image (transparent by default).
         full: Whether to export the current viewport view (false, default) or the entire graph (true).
         scale: This value specifies a positive number that scales the size of the resultant image.
         maxWidth: Specifies the scale automatically in combination with maxHeight such that the resultant image is no wider than maxWidth.
         maxHeight: Specifies the scale automatically in combination with maxWidth such that the resultant image is no taller than maxHeight
         */
        exportPng(){
            this.$message.success("...");
            let blob = this.cy.png({
                output: 'blob-promise', bg: 'white',
                full: true, scale: 4
            });
            blob.then(res => {
                //
                let aLink = document.createElement('a');
                aLink.download = this.generateFileName() + '.png';
                let url = window.URL.createObjectURL(res);
                aLink.href = url;

                //
                let evt = document.createEvent("MouseEvents");
                evt.initEvent("click", true, true);
                aLink.dispatchEvent(evt);

                // blob
                window.URL.revokeObjectURL(url);
            }).catch(err => {
                console.log("Error occured: ", err);
                if (this.cy.elements().length === 0) {
                    this.$message.error("");
                }
            });
        },

        /**
         * 
         * JSON.parse(JSON.stringify(obj))

         1objJSON.stringifyJSON.parse
         2objRegExpError
         3objundefined undefined
         4objNaNInfinity-Infinitynull
         5JSON.stringify() obj JSON.parse(JSON.stringify(obj))constructor
         6


         /
         */
        getDataJsonObject() {
            let eles = JSON.parse(JSON.stringify(this.cy.json().elements));//(**)
            let obj = {"edges": [], "nodes": []};
            if (JSON.stringify(eles) !== '{}') {
                if (eles.edges !== undefined && eles.edges.length > 0) {
                    eles.edges.forEach(val => {
                        obj.edges.push({
                            data: val.data
                        });
                    });
                }
                if (eles.nodes !== undefined && eles.nodes.length > 0) {
                    eles.nodes.forEach(val => {
                        obj.nodes.push({
                            data: val.data,
                            position: val.position
                        });
                    });
                }
            }
            return obj;
        },
        getCleanData(eles) {
            let obj = {"edges": [], "nodes": []};
            if (JSON.stringify(eles) !== '{}') {
                if (eles.edges !== undefined && eles.edges.length > 0) {
                    eles.edges.forEach(val => {
                        obj.edges.push({
                            data: {
                                id:val.data.id,
                                type:val.data.type,
                                relation:val.data.relation,
                                source:val.data.source,
                                target:val.data.target
                            }
                        });
                    });
                }
                if (eles.nodes !== undefined && eles.nodes.length > 0) {
                    eles.nodes.forEach(val => {
                        obj.nodes.push({
                            data: {
                                id:val.data.id,
                                type:val.data.type,
                                name:val.data.name,
                                property:val.data.property
                            },
                            position: val.position
                        });
                    });
                }
            }
            return obj;
        },
        exportJson(){
            this.$message("json...");
            //promise
            let data = this.getDataJsonObject();
            let filename =  this.generateFileName() + '.json';
            if(typeof data === 'object'){
                data = JSON.stringify(data, undefined, 4)
            }
            //  blob 
            let blob = new Blob([data], {type: 'text/json'}),
                a = document.createElement('a');
            a.download = filename;

            // blob
            //  URL  Blob 
            let url = window.URL.createObjectURL(blob)
            a.href = url;

            //  data-   
            a.dataset.downloadurl = ['text/json', a.download, a.href].join(':');

            // 
            let e = document.createEvent('MouseEvents');
            e.initMouseEvent('click', true, false, window, 0, 0, 0, 0, 0, false, false, false, false, 0, null);
            a.dispatchEvent(e);

            // blob
            window.URL.revokeObjectURL(url);
        },

        generateFileName(){
            let name = "";
            try{
                name = this.current_project.project_name;
            }catch (e) {
                console.log("Error occurs:"+e);
                console.log("Server");
                name = new Date().getTime();
            }
            return name;
        },

        /**
         *  data  entities_data  relaions_data 
         */
        get_statistic_data(){
            let data = this.getDataJsonObject();
            let nodes = data.nodes,
                edges = data.edges;
            let EData = {
                individual: 0,
                organization: 0,
                thing: 0,
                default: 0,
                total: nodes.length
            };
            for (let node of nodes){
                if (!(node.data.type == 'individual' || node.data.type == 'organization' || node.data.type == 'thing')){
                    EData['default'] ++;
                }else {
                    EData[node.data.type] ++;
                }
            }
            let RData = {
                connection: 0,
                inheritance: 0,
                default: 0,
                total: edges.length
            }
            for (let edge of edges){
                RData[edge.data.type] ++;
            }
            this.entities_data = [EData];
            this.relations_data = [RData];
        },

        // 

        checkKeyWords(text){
            let nameValid = /\S/;
            let keyWords = [];
            text.forEach(val=>{//
                if(nameValid.test(val)){
                    let item = val.trim();
                    if(!keyWords.includes(item)) keyWords.push(item);
                }
            });
            return keyWords;
        },

        saveSearchLog(keyWords,log){//
            keyWords.forEach(val=>{
                let index = log.findIndex(item=>item===val);
                if(index<0){//
                    log.unshift(val);//
                }

            });
            let maxLen = this.max_log_len;
            if(log.length>maxLen){//
                log.slice(maxLen,log.length-maxLen);
            }
        },

        searchNode(){
            let keyWords = this.checkKeyWords(this.search_node_text);
            let condition = this.search_node_condition;
            this.search_node_text = keyWords;//
            if(keyWords.length===0||condition.length===0){
                this.informMsg('error','');
                return;
            }
            console.log("(keyWords, condition, log) before saveLog",keyWords,condition,this.search_node_log);

            //
            this.saveSearchLog(keyWords,this.search_node_log);//
            console.log("(keyWords, condition, log) after saveLog",keyWords,condition,this.search_node_log);
            const byName = condition.includes('name');
            const byRelation = condition.includes('relation');
            const byProp = condition.includes('property');
            let nodes = this.cy.nodes();
            let count = 0;
            nodes.forEach(val=>{
                if (val.hasClass('searchedNode')) {
                    val.removeClass('searchedNode');
                }
                let valName = val.data("name");
                let valProps = val.data("property");
                let edges = val.connectedEdges();
                let hit = false;
                let relaHit;
                let propHit;
                for(let key of keyWords){
                    if(byName&&this.fuzzyMatch(valName, key)) {
                        hit = true;
                        break;
                    }
                    if(byProp){
                        propHit = false;
                        for(let prop of valProps){
                            if(this.fuzzyMatch(prop, key)){
                                propHit=true;
                                break;
                            }
                        }
                        if(propHit){
                            hit = true;
                            break;
                        }
                    }
                    if(byRelation){
                        relaHit = false;
                        for(let edge of edges){
                            let edgeName = edge.data("relation");
                            if(this.fuzzyMatch(edgeName, key)){
                                relaHit = true;
                                break;
                            }
                        }
                        if(relaHit){
                            hit = true;
                            break;
                        }
                    }
                }
                if(hit){
                    count += 1;
                    val.addClass('searchedNode');
                }
            });
            this.informResult(count > 0,'','')
            this.node_searched = true;
        },

        searchEdge(){
            let keyWords = this.checkKeyWords(this.search_edge_text);
            let condition = this.search_edge_condition;
            this.search_edge_text = keyWords;//
            if(keyWords.length===0||condition.length===0){
                this.informMsg('error','');
                return;
            }

            //
            this.saveSearchLog(keyWords,this.search_edge_log);//
            const byName = condition.includes('relation');
            const bySource = condition.includes('source');
            const byTarget = condition.includes('target');
            let edges = this.cy.edges();
            let count = 0;
            edges.forEach(val=>{
                if (val.hasClass('searchedEdge')) {
                    val.removeClass('searchedEdge');
                }
                let valName = val.data("relation");
                let valSource = this.cy.$id(val.data("source")).data("name");
                let valTarget = this.cy.$id(val.data("target")).data("name");
                let hit = false;
                let nameHit;
                let sHit;
                let tHit;
                for(let key of keyWords){
                    if((byName&&this.fuzzyMatch(valName, key))||
                        (bySource&&this.fuzzyMatch(valSource,key))||
                        (byTarget&&this.fuzzyMatch(valTarget,key))) {
                        hit = true;
                        break;
                    }
                }
                if(hit){
                    count += 1;
                    val.addClass('searchedEdge');
                }
            });
            this.informResult(count > 0,'','');
            this.edge_searched = true;
        },

        informResult(isSuccess,success_msg,error_msg){
            if (isSuccess) {
                this.informMsg('success',success_msg);
            }
            else {
                this.informMsg('error',error_msg);
            }
        },

        informMsg(type,msg) {
            this.$message({
                message: msg,
                type: type,
                duration: 1500
            });
        },

        fuzzyMatch(str, key){//
            let index = -1, flag = false;
            for(let i = 0, arr = key.split(""); i < arr.length; i++ ){
            //
                if(str.indexOf(arr[i]) < 0){
                    break;
                }else{
                    let match = str.matchAll(arr[i]);
                    let next = match.next();
                    while (!next.done){
                        if(next.value.index > index){
                            index = next.value.index;
                            if(i === arr.length - 1){
                                flag = true
                            }
                            break;
                        }
                        next = match.next();
                    }
                }
            }
            return flag;
        },

        desearchNode(){
            let nodes = this.cy.nodes();
            nodes.forEach(val=>{
                if (val.hasClass('searchedNode')) {
                    val.removeClass('searchedNode');
                }
                this.search_node_condition = [];
                this.search_node_text = [];
                this.node_searched = false;
            });
        },

        desearchEdge(){
            let edges = this.cy.edges();
            edges.forEach(val=>{
                if (val.hasClass('searchedEdge')) {
                    val.removeClass('searchedEdge');
                }
                this.search_edge_condition = [];
                this.search_edge_text = [];
                this.edge_searched = false;
            });
        },


        //////////////////////////////////////////////////////////////////////////

        nodeFilter(){
            let checkList = this.filter_node_checkList;
            this.cy.nodes().forEach(val=>{
                let hit = checkList.includes(val.data('type'));
               if(hit&&!val.hasClass('removed')) {
                   val.addClass('removed');
               }else if(!hit&&val.hasClass('removed')){
                   val.removeClass('removed');
               }
            });
        },
        edgeFilter(){
            let checkList = this.filter_edge_checkList;
            this.cy.edges().forEach(val=>{
                let hit = checkList.includes(val.data('type'));
                if(hit&&!val.hasClass('hidden')) {
                    val.addClass('hidden');
                }else if(!hit&&val.hasClass('hidden')){
                    val.removeClass('hidden');
                }
            });
        },
        nodeDefilter(){
            if(this.filter_node_checkList.length===0)return;
            this.cy.nodes().forEach(val=>{
                if(val.hasClass('removed')){
                    val.removeClass('removed');
                }
            });
            this.filter_node_checkList = [];
        },
        edgeDefilter(){
            if(this.filter_edge_checkList.length===0)return;
            this.cy.edges().forEach(val=>{
                if(val.hasClass('hidden')){
                    val.removeClass('hidden');
                }
            });
            this.filter_edge_checkList = [];
        },
    }
}
